import {Link} from "react-router-dom";
import "../styles/Navbar.css"

const Navbar = () => {
    return (
        <div className='navbar'>
            <div className='navbar_links'>
                <Link to='/'>LosLearn</Link>
                <Link to='/about'>О нас</Link>
            </div>
        </div>
    );
};

export default Navbar;
